import s from './Navigation.module.scss';

const Navigation = () => {

    return (
        <>
            <div className={s.wrap}>
                <ul>
                    <li>Home</li>
                    <li>Catalog</li>
                    <li>Basket</li>
                    <li>User Page</li>
                </ul>
            </div>

        </>
    );
}

export default Navigation;
